import React from 'react';
import LinkedIn from '../../assets/images/LinkedIn.png'
import Github from '../../assets/images/Github.png'

function Footer() {   
    return (
    <footer className="footer bg-dark fixed-bottom">
        <a href=""><img src={require("../../assets/images/Github.png")} alt="Github" className="footerimg"/></a>
        <a href=""><img src={require('../../assets/images/LinkedIn.png')} alt="LinkedIn" className="footerimg"/>  </a>
    </footer>
    )
}

export default Footer;
